&lt;!--StartFragment--&gt;

&lt;p&gt;Deadline: Post paper (Word format) to the dropbox on this
page by 10am Monday, November 12. Bring a hardcopy to submit at the start of
lecture (Nov 12).&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;Length: 8 pages&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;Nuts &amp;amp; Bolts: Make sure you&#39;ve re-read the grading
rubric on the syllabus.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;Your Task: Write an essay that explores and analyzes a
debate, question, or problem in Russian cultural history. The choice of topic
is up to you, with the provision that your essay examine change across either
time or space. That said, you are free to define a topic related to art,
architecture, religion, science, ideas, consumption, literature, gender,
customs, etc., and to work on any period prior to 1917. You are strongly
encouraged to meet with Prof. O&#39;Neill and/or Kathryn in order to discuss
feasibility, sources, and approach. (And please bear in mind that for the
purposes of this assignment &quot;Russian culture&quot; refers to the
culture(s) of all inhabitants of the empire.)&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;Sources: While you are welcome to draw on assigned readings
as a supplement you are expected to do your own research. Mine HOLLIS,
Historical Abstracts, JSTOR, Academic Search Premier, the bibliographies on the
course iSite, and other online resources for monographs and articles on your
topic. (Secondary works rather than primary sources are the main concern for
this essay - original research will be the bedrock of the final paper.) Student
bibliographies will vary in scale and scope depending on the topic. While there
is no &quot;magic&quot; number of sources however, those who have not spent
sufficient time researching their topic will no doubt turn in less-than-stellar
work.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;Reminders:&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;Leave time to review your work and edit as necessary.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;If you get stuck, consult the links on the &#39;Research Topics
and Assistance&#39; page of the course iSite and/or contact Kathryn or Prof.
O&#39;Neill.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;Writing history means making an argument about the past.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

