   &lt;br&gt;&lt;p&gt;&lt;span&gt;I was fascinated with this assignment, as I had not yet started to compile these types of strategies. Once during a Science and Math Methods course, Professor Marlene Morales shares a book of CRISS strategies for me and I literately made over one hundred copies of the many strategies listed in it (thank you, Professor Morales!)&amp;nbsp; For this assignment, Dr. Fransisco Brizuela required that we complete this task and I had a wonderful opportunity to continue adding strategies to my personal collection. As such, I needed to do a little research and create a file that was specific to the requirements set by the . I needed to not only add strategies and methodology, but also incorporate different teaching styles and discuss their use and purpose in the classroom. What I learned especially is that a creative teacher needs to include a variety of these into lesson plans in order to keep students interested and learning&amp;nbsp;&lt;span&gt;.&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span&gt;It was not at all difficult to gather this information, in fact, with the internet, it was simply a case of &quot;Google-ing&quot; and choosing which were those that I felt I could actually use. I love cooperative learning and of course, I included that in there since Dr. Lauren Gach first introduced it to me during my K-5 Practicum. I am far from being an expert, but I thought it is definitely something I can see myself using to help students feel independence and ownership of their own learning. Students need much practice in thinking critically and meta-cognitive reasoning.&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span&gt;What do I plan to do now with this file of resources? Indeed, put it to good use! With these strategies and those that I will continue to add, I hope I can give my students opportunities to do so on a daily basis. If you happen to glance on my lesson plans, you are surely to come across a strategy or two. I want to be the teacher that keeps the classroom in active learning and creates opportunities for the students to participate in the teaching process. The strategies that I included here are just the beginning of what I hope becomes an extensive library for me to implement and develop, as I become an expert teacher. I have already incorporated a few with success, but still far from where I want to be!&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;

