&lt;div class=&quot;abstract-content&quot;&gt;&lt;div class=&quot;text full&quot;&gt;Following his departure from Top Gear and an investigation on an alleged sexual assault, Chris Evans has been quiet. Rather than resorting to Twitter  Evans focused his only two tweets since his TG announcement on tennis  the now-former host turned to a column in The Daily Mail.
&lt;div&gt;Click over, ignore the lovely Mercedes-Benz S-Class Cabriolet that Evans is reviewing, and instead pay attention to the classy and respectful remarks about his time on the show. Evans called his brief, six-episode tenure &quot;a complete honor, privilege, and a pleasure,&quot; while insisting he really tried his best.
&lt;/div&gt;&lt;div&gt;&quot;It seems I may well have been a square peg in a round hole,&quot; Evans wrote. &quot;Which is fine if you keep on hammering it in, but the moment you leave it to do its own thing, the universe will quite rightly pop it back out again. I think the phrase is &#39;not meant to be&#39;.&quot;
&lt;/div&gt;&lt;div&gt;After saluting the show&#39;s new cast, Evans delivered effusive praise for TG&#39;s probable new lead, Matt LeBlanc. Considering his allegedly frosty relationship with the American and their absolute lack of chemistry, Evans&#39; warm, friendly, and supportive words are more than we&#39;d expected.
&lt;/div&gt;&lt;div&gt;&quot;May I just take a few lines to assure you what a total mensch and extreme petrolhead Matt LeBlanc is. For me, he is the man. He is the captain Top Gear truly needs going forward, the perfect torso for the rest of TG&#39;s limbs,&quot; Evans says. &quot;Not only does he eat, sleep, breathe, and dream engines, propshafts, and trail-braking, but the overwhelming quality that struck me about him is that he&#39;s just such a pro.&quot;
&lt;/div&gt;&lt;div&gt;&quot;The whole time I worked with him, he never once looked at the clock, was never late on set, knew his lines inside out and back to front, and, most importantly on such an intense production, he always had time for everyone, especially the crew.&quot;
&lt;/div&gt;&lt;div&gt;Evans ends his piece  after reviewing the S-Class, of course  with a clever post script:
&lt;/div&gt;&lt;div&gt;&quot;I am entirely sad Top Gear didn&#39;t work out  I would have loved to have carried on working on it,&quot; the former host wrote. &quot;But letting go with a smile on your face is far better than clinging on till you look constipated. Know what I mean?&quot;
&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;

